class FindShortestPolymer

  def find_shortest_polymer
    input = ''


    chars = input.split('')

    i = 0
    min = 100000
    charAlreadySeen = {}
    polymerLength = {}

    ("a".."z").each do |char|
      if charAlreadySeen[char].nil?
        charAlreadySeen[char] = true
        newChars = chars.select { |c| c !=char && c!= char.upcase}

        polymerLength = reduce_polymer(newChars)
        if polymerLength < min
          min = polymerLength
        end
      end
    end
    puts min

  end

  def reduce_polymer(chars)
    i = 0
    while i < chars.length-1 do
      charA = chars[i]
      charB = chars[i+1]
      if chars_react?(charA, charB)
        chars.slice!(i,2)
        i = i - 2 > 0 ? i - 2 : 0
      else
        i +=1
      end
    end
    chars.length
  end

  def chars_react?(charA, charB)
    charA.ord - charB.ord == 32 || charB.ord - charA.ord == 32
  end

  c = FindShortestPolymer.new
  c.find_shortest_polymer


end
